import httpServ from "../../serviceWorker/http.service";

export const getTicketListAction = () => {
  return (dispatch) => {
    httpServ
      .getListTickets()
      .then((res) => {
        console.log("res", res);
      })
      .catch((err) => {
        console.log("err", err);
      });
  };
};
